import React from "react";

export const Blog = () => {
  return (
    <div id="page-blog">
      <h1>Blog</h1>
      <p>
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Beatae,
        voluptatibus quod! Quaerat delectus numquam nostrum modi possimus
        voluptates quo minus. Deserunt sit recusandae eius possimus? Rerum nisi
        illum nam accusantium!
      </p>
      <img className="img-blog" src="/images/gta-online-2.png" alt="grand theft auto V Online" />

    </div>
  );
};
